import React from 'react';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import Header from './Header';
import NavBar from './NavBar';
import Home from './Home';
import About from './About';
import Unit from './Unit';
import Page from './Page';
import CustomLink from './CustomLink'
import './App.css';

function App() {
  const topics = [
    ['Types of Variables', 'Converting Categorical Data into Numeric Data'],
    ['K-Means', 'Principal Component Analysis (PCA)']
  ];
  const subUnitList = topics.map((list, unitIndex) => <Route path = {`/unit${index+1}`} element={<Unit unit={index+1} subUnitList={list.map((title, subUnitIndex) => <li><CustomLink to={`/unit${unitIndex+1}/${subUnitIndex+1}`} className='subunit'>{title}</CustomLink></li>)} />}></Route>);
  const subUnitRoutes = topics.map((list, unitIndex) => <Routes>{list.map((title, subUnitIndex) => <Route path={`/unit${unitIndex + 1}/${subUnitIndex + 1}`} element={<Page unit={unitIndex + 1} index={subUnitIndex + 1} />}></Route>)}</Routes>);
  return (
    <div>
      <BrowserRouter>
        <Header />
        <NavBar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          {/* {topics.map((list, index) => <Route path={`/unit${index+1}`} element={<Unit unit={index+1} subUnitList={subUnitList[index]}/>}></Route>)}; */}
        </Routes>
        {subUnitRoutes}
      </BrowserRouter>
    </div>
  );
}
export default App;
